import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import apiService from '../apiService';

function CreateMocion() {
    const [form, setForm] = useState({
        Topico: '',
        Tiempo_Del: 0,
        Cant_Del: 0,
        Sesion: '',
        Fecha: ''
    });
    const navigate = useNavigate();

    const handleChange = (e) => {
        const { name, value } = e.target;
        setForm({
            ...form,
            [name]: value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        const tiempoTotal = form.Tiempo_Del * form.Cant_Del;
        const newMocion = { ...form, Tiempo_Total: tiempoTotal };
        try {
            await apiService.createMocion(newMocion);
            navigate('/');
        } catch (error) {
            console.error('Error creating mocion:', error);
        }
    };

    return (
        <form onSubmit={handleSubmit}>
            <label>
                Tópico:
                <input type="text" name="Topico" value={form.Topico} onChange={handleChange} />
            </label>
            <label>
                Tiempo por Delegado:
                <input type="number" name="Tiempo_Del" value={form.Tiempo_Del} onChange={handleChange} />
            </label>
            <label>
                Cantidad de Delegados:
                <input type="number" name="Cant_Del" value={form.Cant_Del} onChange={handleChange} />
            </label>
            <label>
                Sesión:
                <input type="text" name="Sesion" value={form.Sesion} onChange={handleChange} />
            </label>
            <label>
                Fecha:
                <input type="date" name="Fecha" value={form.Fecha} onChange={handleChange} />
            </label>
            <button type="submit">Agregar Moción</button>
        </form>
    );
}

export default CreateMocion;
